import React, { useState } from "react";

import { makeStyles } from "@material-ui/core/styles";
import Chip from "@material-ui/core/Chip";
import Snackbar from "@material-ui/core/Snackbar";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import GridList from "@material-ui/core/GridList";
import Button from "@material-ui/core/Button";
import TextField from "@material-ui/core/TextField";
import GridListTile from "@material-ui/core/GridListTile";
import InputLabel from "@material-ui/core/InputLabel";
import FormHelperText from "@material-ui/core/FormHelperText";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";
import NativeSelect from "@material-ui/core/NativeSelect";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    maxWidth: 720,
    "margin-left": "35%",
  },
  header: {
    "margin-left": "40%",
    "margin-top": "3%",
  },
  button: {
    "margin-top": "3%",
    "margin-left": "3%",
  },
  chip: {
    margin: "5px",
  },
  gridList: {
    height: 500,
    transform: "translateZ(0)",
  },
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
  comp: (props) => ({
    background: props.backgroundColor,
  }),
}));

export default function GuestBook() {
  const classes = useStyles();

  const [name, setName] = React.useState("testname");
  const [description, setDescription] = React.useState("testdes");
  const [message, setMessage] = React.useState("testmess");
  const [viewable, setViewable] = React.useState(false);
  const [contact, setContact] = React.useState("testcont");

  return (
    <div>
      <List className={classes.root}>
        <ListItem>
          <FormControl className={classes.formControl}>
            <TextField
              id="name"
              label=""
              value={name}
              onChange={(event) => setName(event.target.value)}
              margin="normal"
              variant="outlined"
            />
            <FormHelperText>What's your name?</FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <FormControl className={classes.formControl}>
            <TextField
              id="description"
              label="Tell me something about yourself!"
              value={description}
              onChange={(event) => setDescription(event.target.value)}
              margin="normal"
              variant="outlined"
            />
            <FormHelperText>
              Do you want your message to be public?
            </FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <FormControl className={classes.formControl}>
            <TextField
              id="message"
              value={message}
              onChange={(event) => setMessage(event.target.value)}
              margin="normal"
              variant="outlined"
            />
            <FormHelperText>
              Do you want your message to be public?
            </FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <FormControl className={classes.formControl}>
            <NativeSelect
              value={viewable}
              onChange={(event) => setViewable(event.target.value)}
              inputProps={{
                name: "age",
                id: "age-native-helper",
              }}
            >
              <option aria-label="None" value="" />
              <option value={true}>Yes</option>
              <option value={false}>No</option>
            </NativeSelect>
            <FormHelperText>
              Do you want your message to be public?
            </FormHelperText>
          </FormControl>
        </ListItem>
        <ListItem>
          <TextField
            id="email"
            label="What's your email?(won't be posted)"
            value={contact}
            onChange={(event) => setContact(event.target.value)}
            margin="normal"
            variant="outlined"
          />
        </ListItem>
      </List>
    </div>
  );
}
